column329:
I hope you administrators and those in charge nip this in the bud::: beyond just "pretty words" to placate a segment of your student body. I work at a university in Southern California(CSUN
) and this kind of behavior does go on. As a Veteran of Mexican-America
n descent I am ashamed of what is sometimes being taught in the classroom. I did not put my life on the line for this country to have "social justice pansies" spill their vitriolic hate and propaganda on campuses and attempt to subjugate the United States Constitution.
